const INITIAL_STATE = {
    profile: {
        email: 'abc@gmail.com',
        userName: "Katarina Smith",
        password: 123,
        post: "developer"
    }
}

const reducer = (state = INITIAL_STATE ) => {
    return state
}

export default reducer;
